  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Crescent Lake
  National Wildlife Refuge outlines Refuge accomplishments from May through August
  of 1939. The report begins by summarizing the water conditions during this period.
  Wildlife- including migratory birds, predators, rodents, and raptors- is also covered.
  The Refuge development and maintenance section discusses physical developments,
  plantings, collections and receipts, and vegetation control. The public relations
  section of the report describes hunting. N-R forms are attached.\",\n\t\"license_title\":
